import React from "react";
import "./App.css";
import Soundboard from "./components/soundboard";

class App extends Component {
  constructor(props) {
    super(props);
    this.state = {};
  }
  render() {
    return (
      <div className="soundboard">
        <PlayButton />
      </div>
    );
  }
}

export default App;
